#include<iostream>
#include<stdio.h>
#include<algorithm>
using namespace std;class lnm{public:string num;lnm(string s="0"){num=s;}friend ostream& operator<<(ostream&,lnm);friend istream& operator>>(istream&,lnm&);lnm operator+(lnm ntoadd){lnm tr;string s1=num,s2=ntoadd.num;int d1=s1.length(),d2=s2.length(),dm=max(d1,d2),dl=min(d1,d2),c=0,i=0,n;char sm[dm+1];reverse(s1.begin(),s1.end());reverse(s2.begin(),s2.end());for(;i<dl;i++){n=s1[i]+s2[i]+c-2*'0';sm[i]=(n%10)+'0';c=n/10;}if(dm==d1){for(;i<dm;i++){sm[i]=((s1[i]+c-'0')%10)+'0';c=(s1[i]+c-'0')/10;}}else{for(;i<dm;i++){n=s2[i]+c-'0';sm[i]=(n%10)+'0';c=n/10;}}sm[i]=c+'0';if(c==0){char tm[dm];copy(sm,sm+dm,tm);reverse(tm,tm+dm);tr.num=tm;return tr;}reverse(sm,sm+dm+1);tr.num=sm;return tr;}lnm operator*(int mp){lnm tr;lnm p1;lnm p2;reverse(num.begin(),num.end());int n1=mp%10;mp/=10;int n2=mp%10,l=num.length(),cr1=0,cr2=0,i=0;char p1s[l+2],p2s[l+2];for(;i<l;i++){p1s[i]=(cr1+(num[i]-'0')*n1)%10+'0';cr1=(cr1+(num[i]-'0')*n1)/10;p2s[i]=(cr2+(num[i]-'0')*n2)%10+'0';cr2=(cr2+(num[i]-'0')*n2)/10;}p1s[i]=cr1+'0';p2s[i]=cr2+'0';reverse(p1s,p1s+l+1);reverse(p2s,p2s+l+1);p1s[l+1]='\0';p2s[l+1]='\0';p1.num=p1s;p2.num=p2s;p2.num+="0";if(n1==0)tr=purify(p2);else tr=purify(p1+p2);return tr;}friend lnm purify(lnm);};ostream& operator<<(ostream& out,lnm n){out<<n.num;return out;}istream& operator>>(istream& in,lnm& n){in>>n.num;return in;}lnm purify(lnm n){lnm tr;string s=n.num;int l=s.length();char dmy[l],tp[l];copy(s.begin(),s.end(),dmy);int i=0,cnt=0;while(dmy[i]=='0')i++;for(;i<l;i++){if(dmy[i]>'9'||dmy[i]<'0')break;tp[cnt++]=dmy[i];}tp[cnt]='\0';if (tp[cnt-1]!='0')tp[cnt-1]='\0';tr.num=tp;return tr;}int main(){int t;scanf("%d",&t);while(t--){int n;scanf("%d",&n);if(n==0)printf("1\n");else if(n<18){long long int a=1;for(int i=2;i<=n;i++)a*=i;printf("%lld\n",a);}else{lnm a("6402373705728000");for(int i=19;i<=n&&i<100;i++)a=a*i;if(n==100)a.num+="00";cout<<a<<endl;}}}
